cpqDaAccelStatus = MibTableColumn((1, 3, 6, 1, 4, 1, 232, 3, 2, 2, 2, 1, 2), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2, 3, 4, 5, 6, 7, 8, 9))).clone(namedValues=NamedValues(("other", 1), ("invalid", 2), ("enabled", 3), ("tmpDisabled", 4), ("permDisabled", 5), ("cacheModFlashMemNotAttached", 6), ("cacheModDegradedFailsafeSpeed", 7), ("cacheModCriticalFailure", 8), ("cacheReadCacheNotMapped", 9)))).setMaxAccess("readonly")
if mibBuilder.loadTexts: cpqDaAccelStatus.setStatus('mandatory')
if mibBuilder.loadTexts: cpqDaAccelStatus.setDescription("Cache Module/Operations Status. This describes the status of the cache module and/or cache operations. Note that for some controller models, a cache module board that physically attaches to the controller or chipset may not be an available option. For these configurations, the Instrument Agent will continue to populate variables that are related to read caching operations. The status can be: Other (1) Indicates that the instrument agent does not recognize the status of the cache module. You may need to upgrade the instrument agent. Invalid (2) Indicates that a cache module board has not been installed in this system or is present but not configured. Enabled (3) Indicates that cache operations are currently configured and enabled for at least one logical drive. Temporarily Disabled (4) Indicates that cache operations have been temporarily disabled. View the cache module board error code object to determine why the write cache operations have been temporarily disabled. Permanently Disabled (5) Indicates that cache operations have been permanently disabled. View the cache module board error code object to determine why the write cache operations have been disabled. Cache Module Flash Memory Not Attached (6) Indicates that the flash memory component of the flash backed cache module is not attached. This status will be set when the flash memory is not attached and the Supercap is attached. This value is only used on flash backed cache modules that support removable flash memory. Cache Module Degraded Failsafe Speed (7) Indicates that the cache module board is currently degraded and operating at a failsafe speed. View variables cpqDaCacheMemoryDataWidth and cpqDaCacheMemoryTransferRate to obtain the cache module board's current memory data width and memory transfer rate. Cache Module Critical Failure (8) Indicates that the cache module board has encountered a critical failure. The controller is currently operating in Zero Memory Raid mode. Read Cache Could Not Be Mapped (9) Indicates that the read cache memory in a split cache configuration could not be mapped by the operating system and as a result is not available. This status may be caused by virtual space limitations in certain operating systems and is only applicable to B-Series controllers.")
