if mibBuilder.loadTexts: cpqDaLogDrvAvailSpares.setDescription("Drive Array Logical Drive Available Spares. This indicates if this logical drive has one or more spares designated for it that are not currently in use by another drive. Each octet present will be a physical drive ID that is an available spare for this logical drive. These are the same ID's which can be used as indices into the physical drive table. An octet string of length zero indicates that there are no available spares for this logical drive. For array controllers that support a larger number of drives, the Drive Array Logical Drive Available Spare Extended Attachment Table should be used.")
cpqDaLogDrvSize = MibTableColumn((1, 3, 6, 1, 4, 1, 232, 3, 2, 3, 1, 1, 9), Integer32().subtype(subtypeSpec=ValueRangeConstraint(0, 2147483647))).setMaxAccess("readonly")
if mibBuilder.loadTexts: cpqDaLogDrvSize.setStatus('mandatory')
if mibBuilder.loadTexts: cpqDaLogDrvSize.setDescription('Logical Drive Size. This is the size of the logical drive in megabytes. This value is calculated using the value 1,048,576 (2^20) as a megabyte. Drive manufacturers sometimes use the number 1,000,000 as a megabyte when giving drive capacities so this value may differ from the advertised size of a drive.')
