cpqDaLogDrvPercentRebuild = MibTableColumn((1, 3, 6, 1, 4, 1, 232, 3, 2, 3, 1, 1, 12), Gauge32()).setMaxAccess("readonly")
if mibBuilder.loadTexts: cpqDaLogDrvPercentRebuild.setStatus('mandatory')
if mibBuilder.loadTexts: cpqDaLogDrvPercentRebuild.setDescription("Logical Drive Percent Rebuild. After a failed physical drive has been replaced, the physical drive must have its data rebuilt. This value is the percent complete of the rebuild. When the value reaches 100, the rebuilding process is complete. The drive array continues to operate in interim recovery mode while a drive is rebuilding. When a logical volume is Expanding, the drive must redistribute the logical volume data across the physical drives. This value shows how many blocks of data still need to be redistributed. When the value reaches one hundred (100), the expand process is complete. The array continues to operate normally while the drive is expanding. When a logical drive's encryption state is transforming from unencrypted to encrypted or when the logical drive is being rekeyed with a new key, this value is the percent complete of the operation. When the value reaches 100, the transformation or rekey process is complete. This value is only valid if the logical drive status is rebuilding (7), expanding (12), unencryptedToEncryptedInProgress(22) and newLogDrvKeyRekeyInProgress(23). If the value cannot be determined or a rebuild is not active, the value is set to 4,294,967,295.")
