cpqDaLogDrvOsName = MibTableColumn((1, 3, 6, 1, 4, 1, 232, 3, 2, 3, 1, 1, 14), DisplayString().subtype(subtypeSpec=ValueSizeConstraint(0, 255))).setMaxAccess("readonly")
