if mibBuilder.loadTexts: cpqDaLogDrvBlinkTime.setDescription('Logical Drive Physical Drive Blink Time Count. The logical drive blink time variable allows the drive tray LEDs of all physical drives in a logical drive to blink. This value indicates the amount of time, in tenths of a second, that the physical drive LEDs will continue to blink. A value of zero indicates the drive LEDs are not blinking. If the value cannot be determined or no drive in this logical drive is in a hot plug tray, 4,294,967,295 is returned. To blink the drive LEDs on all physical drives in this logical drive (including any configured spare drives), set this value to the time to blink in tenths of seconds. To stop the drive LEDs from blinking, set this value to 0.')
cpqDaLogDrvSpareReplaceMap = MibTableColumn((1, 3, 6, 1, 4, 1, 232, 3, 2, 3, 1, 1, 16), OctetString().subtype(subtypeSpec=ValueSizeConstraint(0, 256))).setMaxAccess("readonly")
