if mibBuilder.loadTexts: cpqDaLogDrvSpareReplaceMap.setDescription('Logical Drive Spare To Replacement Drive Map. This data structure contains the spare to physical drive replacement map. The format is: octet contents ===== ======== 1 Spare drive physical drive index 2 Replaced drive physical drive index These 2 octets are repeated for each replaced drive. For n replaced drives, the string is 2 * n octets long. An octet string of length zero indicates that there are no replaced drives currently in use. For array controllers that support larger number of drives, the Drive Array Logical Drive Spare Replacement Extended Attachment Table should be used.')
