if mibBuilder.loadTexts: cpqDaLogDrvCacheVolAccelCachingAlgorithm.setDescription('Drive Array Logical Drive Cache Volume Accelerator Caching Algorithm. The caching algorithm currently in use for the cache volume. The following values are defined: Other(1) The instrument agent is unable to determine the caching algorithm for this cache volume. You may need to upgrade the instrument agent. Multi Segment(2) Multiple tiers to track cached and potentially cacheable data. The multi-segment cache takes into account frequency, spatial locality and temporal locality of data accesses. The replacement policy is conservative making the algorithm ideal for workloads that have a mixture of cacheable and non-cacheable data with hot spots that remain hot for some time. Single Segment (3) A single tier tracks cached data. The single-segment cache takes into account spatial and temporal locality of data accesses. The replacement policy is very aggressive resulting in the algorithm being ideal for workloads that have very few non-cacheable data accesses and hotspots that move frequently.')
