if mibBuilder.loadTexts: cpqDaLogDrvCacheVolAccelCacheState.setDescription('Drive Array Logical Drive Cache Volume Accelerator Cache State. The current cache state of the cache volume. The following values are defined: Other(1) The instrument agent is unable to determine the cache state of this cache volume. You may need to upgrade the instrument agent. Ok (2) Indicates that the cache volume is in normal operation mode and is fully functional. Degraded (3) Indicates that this cache volume is currently degraded with limited functionality. Cache Volume Offline(4) Indicates that the cache volume member is currently offline. Logical Drive Offline(5) Indicates that the logical drive member is currently offline. Never Configured(6) Indicates that the cache volume was never configured. Flushing(7) Indicates that cache data is currently flushing from DDR cache. Configuring(8) Indicates that cache is currently configuring. Cache Configuration Failed(9) Indicates that cache configuration has failed.')
