if mibBuilder.loadTexts: cpqDaLogDrvCacheVolAccelWritePolicy.setStatus('mandatory')
if mibBuilder.loadTexts: cpqDaLogDrvCacheVolAccelWritePolicy.setDescription("Drive Array Logical Drive Cache Volume Accelerator Write Policy. The write policy that the cache volume has been configured to use. The following values are defined: Other(1) The instrument agent is unable to determine the write policy of this cache volume. You may need to upgrade the instrument agent. Read Only (2) Indicates that this cache volume is currently using a read only policy. Write Through(3) Indicates that this cache volume is currently using a write through policy. Write Back Safe(4) Indicates that this cache volume is currently using a write back safe policy. Writing is being executed to a cache volume that utilizes a redundant RAID level. If the cache volume's redundancy becomes degraded, the cache volume will utilize the write through write policy until redunancy is restored. Write Back Unsafe(5) Indicates that this cache volume is currently using a write back unsafe policy. Writing is being executed to a cache volume that is not utilizing a redundant RAID level. Write Through No Load(6) Indicates that this cache volume is currently using a write through no load policy. The cache volume will process write requests but will only write if the line is already loaded.")
