cpqDaPhyDrvFWRev = MibTableColumn((1, 3, 6, 1, 4, 1, 232, 3, 2, 5, 1, 1, 4), DisplayString().subtype(subtypeSpec=ValueSizeConstraint(0, 8))).setMaxAccess("readonly")
if mibBuilder.loadTexts: cpqDaPhyDrvFWRev.setStatus('mandatory')
if mibBuilder.loadTexts: cpqDaPhyDrvFWRev.setDescription('Physical Drive Firmware Revision. This shows the physical drive revision number. If the firmware revision is not present, you have not properly initialized the drive array.')
cpqDaPhyDrvBay = MibTableColumn((1, 3, 6, 1, 4, 1, 232, 3, 2, 5, 1, 1, 5), Integer32().subtype(subtypeSpec=ValueRangeConstraint(0, 255))).setMaxAccess("readonly")
if mibBuilder.loadTexts: cpqDaPhyDrvBay.setStatus('mandatory')
if mibBuilder.loadTexts: cpqDaPhyDrvBay.setDescription('Physical Drive Bay Location. This value matches the bay location where the physical drive has been installed. For a SCSI drive, this is the SCSI ID of the drive. For a SAS or SATA drive, this is the bay number on the enclosure.')
cpqDaPhyDrvStatus = MibTableColumn((1, 3, 6, 1, 4, 1, 232, 3, 2, 5, 1, 1, 6), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2, 3, 4, 5, 6, 7, 8, 9))).clone(namedValues=NamedValues(("other", 1), ("ok", 2), ("failed", 3), ("predictiveFailure", 4), ("erasing", 5), ("eraseDone", 6), ("eraseQueued", 7), ("ssdWearOut", 8), ("notAuthenticated", 9)))).setMaxAccess("readonly")
if mibBuilder.loadTexts: cpqDaPhyDrvStatus.setStatus('mandatory')
if mibBuilder.loadTexts: cpqDaPhyDrvStatus.setDescription('Physical Drive Status. This shows the status of the physical drive. The following values are valid for the physical drive status: Other (1) Indicates that the instrument agent does not recognize the drive. You may need to upgrade your instrument agent and/or driver software. Ok (2) Indicates the drive is functioning properly. Failed (3) Indicates that the drive is no longer operating and should be replaced. Predictive Failure(4) Indicates that the drive has a predictive failure error and should be replaced. Erasing(5) Indicates that the drive is being erased. Erase Done(6) Indicates that the drive has been erased and is now in an offline state. Erase Queued(7) Indicates that an erase operation is currently queued for the drive. SSD Wear Out(8) Indicates that a solid state drive is approaching the maximum usage limit for writes (wear out) and should be replaced as soon as possible. Not Authenticated(9) Indicates the physical drive could not be authenticated as a genuine HP hard drive. The array controller will no longer control the drive LEDs. Please replace the hard drive with a genuine HP hard drive.')
cpqDaPhyDrvFactReallocs = MibTableColumn((1, 3, 6, 1, 4, 1, 232, 3, 2, 5, 1, 1, 7), Integer32()).setMaxAccess("readonly")
if mibBuilder.loadTexts: cpqDaPhyDrvFactReallocs.setStatus('mandatory')
if mibBuilder.loadTexts: cpqDaPhyDrvFactReallocs.setDescription('This shows the number of spare sectors available for remapping at the time the physical drive was shipped. The physical drive will use these spare sectors for remapping bad sectors that exist on the drive. Not all drives support factory reallocation.')
cpqDaPhyDrvUsedReallocs = MibTableColumn((1, 3, 6, 1, 4, 1, 232, 3, 2, 5, 1, 1, 8), Counter32()).setMaxAccess("readonly")
if mibBuilder.loadTexts: cpqDaPhyDrvUsedReallocs.setStatus('mandatory')
if mibBuilder.loadTexts: cpqDaPhyDrvUsedReallocs.setDescription('Physical Drive Used Reallocated Sectors. This shows the number of sectors of the reallocation area that have been used by the physical drive. To see how many sectors were originally available for use in the reallocation area, refer to the factory reallocation information if it exists. Not all drives support factory reallocation. Because of the nature of magnetic disks, certain sectors on a drive may have media defects. The reallocation area is part of the disk drive that the drive manufacturer sets aside to compensate for these defects. The drive array controller writes information addressed from these unusable sectors to available sectors in the reallocation area. If too many sectors have been reallocated, there may be a problem with the drive. If you suspect a problem, schedule server down time to run diagnostics to verify that a problem exists.')
cpqDaPhyDrvRefHours = MibTableColumn((1, 3, 6, 1, 4, 1, 232, 3, 2, 5, 1, 1, 9), Counter32()).setMaxAccess("readonly")
if mibBuilder.loadTexts: cpqDaPhyDrvRefHours.setStatus('mandatory')
if mibBuilder.loadTexts: cpqDaPhyDrvRefHours.setDescription('Reference Time in hours. This shows the total number of hours that a physical drive has been in operation since the drive was stamped. The drive will have either been stamped when it left the factory or when you ran diagnostics on your new drive. You can use the reference time to calculate rates for other physical drive events.')
cpqDaPhyDrvHReads = MibTableColumn((1, 3, 6, 1, 4, 1, 232, 3, 2, 5, 1, 1, 10), Counter32()).setMaxAccess("readonly")
if mibBuilder.loadTexts: cpqDaPhyDrvHReads.setStatus('mandatory')
if mibBuilder.loadTexts: cpqDaPhyDrvHReads.setDescription('Sectors Read (high). The phyDrvHReads and the phyDrvReads together shows the total number of sectors read from the physical disk drive during the reference time (phyDrvRefHours). The actual number of sectors read equals the phyDrvHReads times 2^32 plus the phyDrvReads. This information may be useful for determining rates. For instance, if you wanted to calculate the average number of reads per hour of operation, divide this number by the reference hours.')
cpqDaPhyDrvReads = MibTableColumn((1, 3, 6, 1, 4, 1, 232, 3, 2, 5, 1, 1, 11), Counter32()).setMaxAccess("readonly")
if mibBuilder.loadTexts: cpqDaPhyDrvReads.setStatus('mandatory')
if mibBuilder.loadTexts: cpqDaPhyDrvReads.setDescription('Sectors Read (low). The phyDrvHReads and the phyDrvReads together shows the total number of sectors read from the physical disk drive during the reference time (phyDrvRefHours). The actual number of sectors read equals the phyDrvHReads times 2^32 plus the phyDrvReads. This information may be useful for determining rates. For instance, if you wanted to calculate the average number of reads per hour of operation, divide this number by the reference hours.')
cpqDaPhyDrvHWrites = MibTableColumn((1, 3, 6, 1, 4, 1, 232, 3, 2, 5, 1, 1, 12), Counter32()).setMaxAccess("readonly")
if mibBuilder.loadTexts: cpqDaPhyDrvHWrites.setStatus('mandatory')
if mibBuilder.loadTexts: cpqDaPhyDrvHWrites.setDescription('Sectors Written (high). The phyDrvHWrites and the phyDrvWrites together shows the total number of sectors written to the physical disk drive during the reference hours (phyDrvRefHours). The actual number of sectors written equals the phyDrvHWrites times 2^32 plus the phyDrvWrites. This information may be useful for determining rates. For instance, if you wanted to calculate the average number of writes per hour of operation, divide this number by the reference hours. ')
cpqDaPhyDrvWrites = MibTableColumn((1, 3, 6, 1, 4, 1, 232, 3, 2, 5, 1, 1, 13), Counter32()).setMaxAccess("readonly")
if mibBuilder.loadTexts: cpqDaPhyDrvWrites.setStatus('mandatory')
if mibBuilder.loadTexts: cpqDaPhyDrvWrites.setDescription('Sectors Written (low). The phyDrvHWrites and the phyDrvWrites together shows the total number of sectors written to the physical disk drive during the reference hours (phyDrvRefHours). The actual number of sectors written equals the phyDrvHWrites times 2^32 plus the phyDrvWrites. This information may be useful for determining rates. For instance, if you wanted to calculate the average number of writes per hour of operation, divide this number by the reference hours. ')
cpqDaPhyDrvHSeeks = MibTableColumn((1, 3, 6, 1, 4, 1, 232, 3, 2, 5, 1, 1, 14), Counter32()).setMaxAccess("readonly")
if mibBuilder.loadTexts: cpqDaPhyDrvHSeeks.setStatus('mandatory')
if mibBuilder.loadTexts: cpqDaPhyDrvHSeeks.setDescription('Total Seeks (high). The phyDrvHSeeks and the phyDrvSeeks together shows the total number of seek operations performed by the physical disk drive during the reference hours (phyDrvRefHours). The actual number of seeks equals the phyDrvHSeeks times 2^32 plus the phyDrvWriteSeeks.')
cpqDaPhyDrvSeeks = MibTableColumn((1, 3, 6, 1, 4, 1, 232, 3, 2, 5, 1, 1, 15), Counter32()).setMaxAccess("readonly")
if mibBuilder.loadTexts: cpqDaPhyDrvSeeks.setStatus('mandatory')
if mibBuilder.loadTexts: cpqDaPhyDrvSeeks.setDescription('Total Seeks (low). The phyDrvHSeeks and the phyDrvSeeks together shows the total number of seek operations performed by the physical disk drive during the reference hours (phyDrvRefHours). The actual number of seeks equals the phyDrvHSeeks times 2^32 plus the phyDrvWriteSeeks.')
cpqDaPhyDrvHardReadErrs = MibTableColumn((1, 3, 6, 1, 4, 1, 232, 3, 2, 5, 1, 1, 16), Counter32()).setMaxAccess("readonly")
if mibBuilder.loadTexts: cpqDaPhyDrvHardReadErrs.setStatus('mandatory')
if mibBuilder.loadTexts: cpqDaPhyDrvHardReadErrs.setDescription("Hard Read Errors. This shows the number of read errors that have occurred on a drive that could not be recovered by a physical drive's Error Correction Code (ECC) algorithm or through retries during the reference time (phyDrvRefTime). Over time, a disk drive may produce these errors. If you receive these errors, a problem may exist with your drive. The value increases every time the physical drive detects another error. The severity of these errors depends on whether the monitored system is running in a fault tolerant mode. With fault tolerance, the controller can remap data to eliminate the problems caused by these errors. In either case, if you see an increase in these errors, schedule server down time to run diagnostics to verify that a problem exists.")
cpqDaPhyDrvRecvReadErrs = MibTableColumn((1, 3, 6, 1, 4, 1, 232, 3, 2, 5, 1, 1, 17), Counter32()).setMaxAccess("readonly")
if mibBuilder.loadTexts: cpqDaPhyDrvRecvReadErrs.setStatus('mandatory')
if mibBuilder.loadTexts: cpqDaPhyDrvRecvReadErrs.setDescription('Recovered Read Errors. This shows the number of read errors corrected through physical drive retries during the reference time (phyDrvRefTime). Over time, all disk drives produce these errors. If you notice a rapid increase in the value for Recovered Read Errors (or Hard Read Errors), a problem may exist with the drive. The value increases every time the physical drive detects and corrects another error. Expect more Recovered Read Errors than Hard Read Errors. If you suspect that a problem may exist with the drive, schedule server down time to run diagnostics.')
cpqDaPhyDrvHardWriteErrs = MibTableColumn((1, 3, 6, 1, 4, 1, 232, 3, 2, 5, 1, 1, 18), Counter32()).setMaxAccess("readonly")
if mibBuilder.loadTexts: cpqDaPhyDrvHardWriteErrs.setStatus('mandatory')
if mibBuilder.loadTexts: cpqDaPhyDrvHardWriteErrs.setDescription('Hard Write Errors. This shows the number of write errors that could not be recovered by a physical drive during the reference time (phyDrvRefTime). Over time a disk drive may detect these errors. If you notice an increase in the value shown for Hard Write Errors or Recovered Write Errors, a problem may exist with the drive. The value increases every time the physical drive detects another error. On average, these errors should occur less frequently than read errors. If you see an increase in these errors, schedule server down time to run diagnostics to verify that a problem exists.')
cpqDaPhyDrvRecvWriteErrs = MibTableColumn((1, 3, 6, 1, 4, 1, 232, 3, 2, 5, 1, 1, 19), Counter32()).setMaxAccess("readonly")
if mibBuilder.loadTexts: cpqDaPhyDrvRecvWriteErrs.setStatus('mandatory')
if mibBuilder.loadTexts: cpqDaPhyDrvRecvWriteErrs.setDescription('Recovered Write Errors. This shows the number of write errors corrected through physical drive retries or recovered by a physical drive during the reference time (phyDrvRefTime). Over time a disk drive may produce these errors. If you notice an increase in the value shown for Hard Write Errors or Recovered Write Errors, a problem may exist with the drive. The value increases every time the physical drive detects and corrects an error. Only an unusually rapid increase in these errors indicates a problem. On average, these errors should occur less frequently than hard read errors. If you suspect that a problem may exist with the drive, schedule server down time to run diagnostics.')
cpqDaPhyDrvHSeekErrs = MibTableColumn((1, 3, 6, 1, 4, 1, 232, 3, 2, 5, 1, 1, 20), Counter32()).setMaxAccess("readonly")
if mibBuilder.loadTexts: cpqDaPhyDrvHSeekErrs.setStatus('mandatory')
if mibBuilder.loadTexts: cpqDaPhyDrvHSeekErrs.setDescription('Seek Errors (High). The phyDrvHSeekErrs and the phyDrvSeekErrs together shows the total number of times that the physical disk drive detected a seek error during the reference hours (phyDrvRefHours). The actual number of seek errors equals the phyDrvHSeekErrs times 2^32 plus the phyDrvWriteSeekErrs. Over time, a disk drive usually produces these errors. If you notice a rapid increase in the value shown for Seek Errors, this physical drive may be failing. The value increases every time the physical drive produces another error. Only an unusually rapid increase in these errors indicates a problem. If you suspect that a problem exists, schedule server down time to run diagnostics.')
cpqDaPhyDrvSeekErrs = MibTableColumn((1, 3, 6, 1, 4, 1, 232, 3, 2, 5, 1, 1, 21), Counter32()).setMaxAccess("readonly")
if mibBuilder.loadTexts: cpqDaPhyDrvSeekErrs.setStatus('mandatory')
if mibBuilder.loadTexts: cpqDaPhyDrvSeekErrs.setDescription('Seek Errors (low). The phyDrvHSeekErrs and the phyDrvSeekErrs together shows the total number of times that the physical disk drive detected a seek error during the reference hours (phyDrvRefHours). The actual number of seek errors equals the phyDrvHSeekErrs times 2^32 plus the phyDrvWriteSeekErrs. Over time, a disk drive usually produces these errors. If you notice a rapid increase in the value shown for Seek Errors, this physical drive may be failing. The value increases every time the physical drive produces another error. Only an unusually rapid increase in these errors indicates a problem. If you suspect that a problem exists, schedule server down time to run diagnostics.')
cpqDaPhyDrvSpinupTime = MibTableColumn((1, 3, 6, 1, 4, 1, 232, 3, 2, 5, 1, 1, 22), Integer32()).setMaxAccess("readonly")
if mibBuilder.loadTexts: cpqDaPhyDrvSpinupTime.setStatus('mandatory')
if mibBuilder.loadTexts: cpqDaPhyDrvSpinupTime.setDescription("Spin up Time in tenths of seconds. This is the time it takes for a physical drive to spin up to full speed. Disks require time to gain momentum and reach operating speed. As cars are tested to go from 0 mph to 60 mph in x number of seconds, drive manufacturers have preset expectations for the time it takes the drive to spin to full speed. Drives that do not meet these expectations may have problems. The value may be zero (0) under one of the following conditions: * If you are monitoring a physical drive that is part of the monitored system's internal drive array storage, and you use a warm boot to reset the monitored system. During a warm boot, the drives continue to spin. * If you are monitoring a physical drive in an ProLiant Storage System and you reset the monitored system but not the ProLiant Storage System.")
cpqDaPhyDrvFunctTest1 = MibTableColumn((1, 3, 6, 1, 4, 1, 232, 3, 2, 5, 1, 1, 23), Gauge32()).setMaxAccess("readonly")
if mibBuilder.loadTexts: cpqDaPhyDrvFunctTest1.setStatus('deprecated')
if mibBuilder.loadTexts: cpqDaPhyDrvFunctTest1.setDescription('Functional Test 1. This provides information about a series of tests that indicate how well a physical drive works. These tests compare the way the physical drive currently operates when performing various tasks with the way it worked when it was new. A percent value is displayed that represents how the drive works currently when compared to how the drive worked when new. New drives operate at the 100 percent level. By default, if the current value is less than or equal to 80 percent, a problem may exist. If you suspect a problem, schedule server down time to run diagnostics to verify that a problem exists. If the value cannot be determined, it is set to 4,294,967,295.')
cpqDaPhyDrvFunctTest2 = MibTableColumn((1, 3, 6, 1, 4, 1, 232, 3, 2, 5, 1, 1, 24), Gauge32()).setMaxAccess("readonly")
if mibBuilder.loadTexts: cpqDaPhyDrvFunctTest2.setStatus('deprecated')
if mibBuilder.loadTexts: cpqDaPhyDrvFunctTest2.setDescription('Functional Test 2. This provides information about a series of tests that indicate how well a physical drive works. These tests compare the way the physical drive currently operates when performing various tasks with the way it worked when it was new. A percent value is displayed that represents how the drive works currently when compared to how the drive worked when new. New drives operate at the 100 percent level. By default, if the current value is less than or equal to 80 percent, a problem may exist. If you suspect a problem, schedule server down time to run diagnostics to verify that a problem exists. If the value cannot be determined, it is set to 4,294,967,295.')
cpqDaPhyDrvFunctTest3 = MibTableColumn((1, 3, 6, 1, 4, 1, 232, 3, 2, 5, 1, 1, 25), Gauge32()).setMaxAccess("readonly")
if mibBuilder.loadTexts: cpqDaPhyDrvFunctTest3.setStatus('deprecated')
if mibBuilder.loadTexts: cpqDaPhyDrvFunctTest3.setDescription('Functional Test 3. This provides information about a series of tests that indicate how well a physical drive works. These tests compare the way the physical drive currently operates when performing various tasks with the way it worked when it was new. A percent value is displayed that represents how the drive works currently when compared to how the drive worked when new. New drives operate at the 100 percent level. By default, if the current value is less than or equal to 80 percent, a problem may exist. If you suspect a problem, schedule server down time to run diagnostics to verify that a problem exists. If the value cannot be determined, it is set to 4,294,967,295.')
cpqDaPhyDrvDrqTimeouts = MibTableColumn((1, 3, 6, 1, 4, 1, 232, 3, 2, 5, 1, 1, 26), Counter32()).setMaxAccess("readonly")
if mibBuilder.loadTexts: cpqDaPhyDrvDrqTimeouts.setStatus('mandatory')
if mibBuilder.loadTexts: cpqDaPhyDrvDrqTimeouts.setDescription('DRQ Timeouts. The number of times that a physical drive continued to request data, but did not get a command completion during the reference time (phyDrvRefTime). This value increases every time a DRQ timeout occurs for the physical drive. A defective drive or cable may cause DRQ timeouts to occur. If you see an increase in these errors, complete the following steps for the monitored system: 1. Check the cables connecting the drive to ensure that they are intact. 2. If the cables are properly connected, schedule server down time to run diagnostics to verify that a problem exists. If the value is not supported, it is set to 4,294,967,295.')
cpqDaPhyDrvOtherTimeouts = MibTableColumn((1, 3, 6, 1, 4, 1, 232, 3, 2, 5, 1, 1, 27), Counter32()).setMaxAccess("readonly")
if mibBuilder.loadTexts: cpqDaPhyDrvOtherTimeouts.setStatus('mandatory')
if mibBuilder.loadTexts: cpqDaPhyDrvOtherTimeouts.setDescription('Other Timeouts. The number of times that a physical drive did not respond with an interrupt within a controller-defined period of time after a command had been issued during the reference time (phyDrvRefTime). This does not include DRQ timeouts. If you suspect a problem, complete the following steps for the monitored system: 1. Check the cables connecting the drive to ensure that they are intact. 2. If the cables are properly connected, schedule server down time to run diagnostics to verify that a problem exists.')
cpqDaPhyDrvSpinupRetries = MibTableColumn((1, 3, 6, 1, 4, 1, 232, 3, 2, 5, 1, 1, 28), Counter32()).setMaxAccess("readonly")
if mibBuilder.loadTexts: cpqDaPhyDrvSpinupRetries.setStatus('mandatory')
if mibBuilder.loadTexts: cpqDaPhyDrvSpinupRetries.setDescription('Spin up Retries. The number of times that a physical drive had to retry to spin up before successfully achieving operating speed during the reference time (phyDrvRefTime). This value represents the spin-up retries that occurred since the last time you turned on the monitored system. If you suspect a problem, schedule server down time to run diagnostics verify that a problem exists.')
cpqDaPhyDrvBadRecvReads = MibTableColumn((1, 3, 6, 1, 4, 1, 232, 3, 2, 5, 1, 1, 29), Counter32()).setMaxAccess("readonly")
if mibBuilder.loadTexts: cpqDaPhyDrvBadRecvReads.setStatus('mandatory')
if mibBuilder.loadTexts: cpqDaPhyDrvBadRecvReads.setDescription('Recovery Failed (Bad) Read Error. The number of times a read error occurred while performing Automatic Data Recovery from this physical drive to another drive during the reference time (phyDrvRefTime). If a read error occurs, Automatic Data Recovery stops. These errors indicate that the physical drive has failed. If you suspect a problem, schedule server down time to run diagnostics to verify that a problem exists.')
cpqDaPhyDrvBadRecvWrites = MibTableColumn((1, 3, 6, 1, 4, 1, 232, 3, 2, 5, 1, 1, 30), Counter32()).setMaxAccess("readonly")
if mibBuilder.loadTexts: cpqDaPhyDrvBadRecvWrites.setStatus('mandatory')
if mibBuilder.loadTexts: cpqDaPhyDrvBadRecvWrites.setDescription('Recovery Failed (Bad) Write Error. The number of times a write error occurred while performing Automatic Data Recovery from another drive to this physical drive during the reference time (phyDrvRefTime). If a write error occurs, Automatic Data Recovery stops. These errors indicate that the physical drive has failed. If you suspect a problem, schedule server down time to run diagnostics to verify that a problem exists.')
cpqDaPhyDrvFormatErrs = MibTableColumn((1, 3, 6, 1, 4, 1, 232, 3, 2, 5, 1, 1, 31), Counter32()).setMaxAccess("readonly")
if mibBuilder.loadTexts: cpqDaPhyDrvFormatErrs.setStatus('mandatory')
if mibBuilder.loadTexts: cpqDaPhyDrvFormatErrs.setDescription('Format Error. The number of times a format operation failed when the controller attempted to remap a bad sector during the reference time (phyDrvRefTime). Zero indicates that no format errors have occurred. The value increases each time a format error occurs. A failed format operation may cause the controller to mark a drive failed. If you suspect a problem, schedule server down time to run diagnostics verify a problem exists.')
cpqDaPhyDrvPostErrs = MibTableColumn((1, 3, 6, 1, 4, 1, 232, 3, 2, 5, 1, 1, 32), Counter32()).setMaxAccess("readonly")
if mibBuilder.loadTexts: cpqDaPhyDrvPostErrs.setStatus('mandatory')
if mibBuilder.loadTexts: cpqDaPhyDrvPostErrs.setDescription('Power On Self Test (Post) Error. The number of times that a physical drive failed its self test during the reference time (phyDrvRefTime). The physical drive does a self test each time power is applied to the system. If the value is not supported, it is set to 4,294,967,295.')
cpqDaPhyDrvNotReadyErrs = MibTableColumn((1, 3, 6, 1, 4, 1, 232, 3, 2, 5, 1, 1, 33), Counter32()).setMaxAccess("readonly")
if mibBuilder.loadTexts: cpqDaPhyDrvNotReadyErrs.setStatus('mandatory')
if mibBuilder.loadTexts: cpqDaPhyDrvNotReadyErrs.setDescription('Drive Not Ready Errors. The number of times the physical drive failed after the spin up command was issued during the reference time (phyDrvRefTime). When the spin up command was issued, the drive failed to reach its ready state. If the current value is zero, the drive has not failed. If the current value is greater than zero, at least one failure occurred. This error could be caused because the physical drive has failed to spin. If you suspect a problem: 1. Check the cables connecting the drive to ensure that they are intact. 2. If the cables are properly connected, schedule server down time to run diagnostics to verify that a problem exists.')
cpqDaPhyDrvReallocAborts = MibTableColumn((1, 3, 6, 1, 4, 1, 232, 3, 2, 5, 1, 1, 34), Counter32()).setMaxAccess("readonly")
if mibBuilder.loadTexts: cpqDaPhyDrvReallocAborts.setStatus('mandatory')
if mibBuilder.loadTexts: cpqDaPhyDrvReallocAborts.setDescription('Physical Drive Reallocation Aborts. The number of times the physical drive has failed due to an error that occurred when the controller was trying to reallocate a bad sector during the reference time (phyDrvRefTime). Zero (0) indicates that no Reallocation Abort errors have occurred. The value increases each time a Reallocation Abort error occurs. Because of the nature of magnetic disks, certain sectors on a drive may have media defects. The reallocation area is part of the disk drive that is set aside to compensate for these defects. The array controller writes information addressed from unusable sectors to available sectors in the reallocation area. If you suspect a problem, schedule server down time to run diagnostics verify a problem exists.')
cpqDaPhyDrvThreshPassed = MibTableColumn((1, 3, 6, 1, 4, 1, 232, 3, 2, 5, 1, 1, 35), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2))).clone(namedValues=NamedValues(("false", 1), ("true", 2)))).setMaxAccess("readonly")
if mibBuilder.loadTexts: cpqDaPhyDrvThreshPassed.setStatus('mandatory')
if mibBuilder.loadTexts: cpqDaPhyDrvThreshPassed.setDescription('Physical Drive Factory Threshold Passed (Exceeded). When the drive is shipped, certain thresholds have been set to monitor performance of the drives. For example, a threshold might be set for Spin up Time. If the time that it takes the drive to spin up exceeds the factory threshold, there may be a problem with one of the drives. If you suspect a problem, schedule server down time to run diagnostics. Note: These thresholds may be under warranty under certain conditions.')
cpqDaPhyDrvHasMonInfo = MibTableColumn((1, 3, 6, 1, 4, 1, 232, 3, 2, 5, 1, 1, 36), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2))).clone(namedValues=NamedValues(("false", 1), ("true", 2)))).setMaxAccess("readonly")
if mibBuilder.loadTexts: cpqDaPhyDrvHasMonInfo.setStatus('mandatory')
if mibBuilder.loadTexts: cpqDaPhyDrvHasMonInfo.setDescription('Physical Drive Has Monitor Information. All of the physical disk table fields except for the physical disk status (phyDrvStatus) and the bay location (phyDrvBayLocation) are invalid unless this field has a value of true(2).')
cpqDaPhyDrvCondition = MibTableColumn((1, 3, 6, 1, 4, 1, 232, 3, 2, 5, 1, 1, 37), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2, 3, 4))).clone(namedValues=NamedValues(("other", 1), ("ok", 2), ("degraded", 3), ("failed", 4)))).setMaxAccess("readonly")
if mibBuilder.loadTexts: cpqDaPhyDrvCondition.setStatus('mandatory')
if mibBuilder.loadTexts: cpqDaPhyDrvCondition.setDescription('The condition of the device. This value represents the overall condition of this physical drive.')
cpqDaPhyDrvHotPlugs = MibTableColumn((1, 3, 6, 1, 4, 1, 232, 3, 2, 5, 1, 1, 38), Counter32()).setMaxAccess("readonly")
if mibBuilder.loadTexts: cpqDaPhyDrvHotPlugs.setStatus('mandatory')
if mibBuilder.loadTexts: cpqDaPhyDrvHotPlugs.setDescription('Physical Drive Hot Plug Count. This value indicates the number of times this physical drive was hot-plugged (removed) from a ProLiant Storage System. This is not supported by the IDA, IDA Expansion, or IDA-2 controllers.')
cpqDaPhyDrvMediaErrs = MibTableColumn((1, 3, 6, 1, 4, 1, 232, 3, 2, 5, 1, 1, 39), Counter32()).setMaxAccess("readonly")
if mibBuilder.loadTexts: cpqDaPhyDrvMediaErrs.setStatus('mandatory')
if mibBuilder.loadTexts: cpqDaPhyDrvMediaErrs.setDescription('Physical Drive Media Failure Count. This value indicates the number of times this physical drive was failed due to unrecoverable media errors. This is not supported by the IDA, IDA Expansion, or IDA-2 controllers.')
