if mibBuilder.loadTexts: cpqDaPhyDrvSSDWearStatus.setDescription('Drive Array Physical Drive Solid State Disk Wear Status. This shows the wear status of the solid state physical drive. The following values are valid for the physical drive solid state wear status: Other (1) The instrument agent is unable to determine the physical drives solid state disk wear status. This value would be used for non SSD drives or SSD drives that do not support wear reporting. Ok (2) Indicates the solid state disk is not in any imminent danger of wear out. Fifty Six Day Threshold Passed (3) Indicates that based upon the current workload, the solid state disk will reach the maximum usage limit for writes (wear out) within fifty-six days. You should modify your write workload or begin preparing to replace your SSD drive. Five Percent Threshold Passed (4) Indicates that the solid state disk has passed the five percent threshold and is at or below five percent of reaching the maximum usage limit for writes (wear out). You should begin to prepare to replace your SSD drive. Two Percent Threshold Passed (5) Indicates that the solid state disk has passed the two percent threshold and is at or below two percent of reaching the maximum usage limit for writes (wear out). You should begin to prepare to replace your SSD drive. SSD Wear Out(6) Indicates that a solid state drive is approaching the maximum usage limit for writes (wear out) and should be replaced as soon as possible.')
